def regression(x,y):
	H=np.mat(np.dot(x.T,x))
	A=np.dot(np.dot(H.I,x.T),y)
	pred=np.dot(x,A)
	err=y-pred
	loss=np.dot(err.T,err)/len(err)
	return err,A,pred,loss

def regression2(x,y):	#with intercept
	x=np.concatenate((x,np.ones([len(x),1])),axis=1)
	return regression(x,y)
	

